import React from "react";
import "../Styles/header.css";

function Header() {
  return (
    <>
      <div className="header">
        <div className="title">Table Question Answering Model</div>
        <ul class="navbar-nav me-auto mb-2 mb-lg-0" style="position: absolute; left: 86px;">
          <li class="nav-item">
            <a class="nav-link active" aria-current="page" href="#">
              Home
            </a>
          </li>
        </ul>
      </div>
    </>
  );
}

export default Header;
